const menuBtn=document.querySelector(".menu-btn"),navContact=document.querySelector(".nav_links-content");let menuOpen=!1;menuBtn.addEventListener("click",(()=>{menuOpen?(menuBtn.classList.remove("menu_burger-open"),navContact.classList.remove("active"),document.body.style.overflow="visible",menuOpen=!1):(menuBtn.classList.add("menu_burger-open"),navContact.classList.add("active"),document.body.style.overflow="hidden",menuOpen=!0)}));